import React from 'react';


const Logo = (props) => {
   const { image, title, goto } = props;

   return (
      <div className='logo--content'>

         <a href={`${goto}`}>
            <div className='logo--content__img mb--l'>
               <img src={`${image}`} alt={title} />
            </div>

         </a>
      </div>
   );
};

export default Logo;
